<div class="entities" style="line-height: 2.5; direction: ltr">P62158 and troponin C : affinity chromatographic study of divalent cation requirements for troponin I inhibitory peptide ( residues 104-115 ) , mastoparan and fluphenazine binding . The different conformations induced by the binding of Mg2 + or Ca2 + to troponin C ( TnC ) and calmodulin ( P62158 ) results in the exposure of various interfaces with potential to bind target compounds . The interaction of TnC or P62158 with three affinity columns with ligands of either the synthetic peptide of troponin I ( TnI ) inhibitory region ( residues 104-115 ) , mastoparan ( a wasp venom peptide ) , or fluphenazine ( a phenothiazine drug ) were investigated in the presence of Mg2 + or Ca2 + . TnC and P62158 in the presence of either Ca2 + or Mg2 + bound to the TnI peptide 104-115 . The cation specificity for this interaction firmly establishes that the TnI inhibitory region binds to the high affinity sites of TnC ( most likely the N-terminal helix of site III ) and presumably the homologous region of P62158 . Mastoparan interacted strongly with both proteins in the presence of Ca2 + but , in the presence of Mg2 + , did not bind to TnC and only bound weakly to P62158 .

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35372
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 phosphorylation , desensitization , and ligand efficacy . Mu opioid receptors are subject to phosphorylation and desensitization through actions of at least two distinct biochemical pathways : agonist-dependent mu receptor phosphorylation and desensitization induced by a biochemically distinct second pathway dependent on protein kinase C activation ( 1 ) . To better understand the nature of the agonist-induced mu receptor phosphorylation events , we have investigated the effects of a variety of opiate ligands of varying potencies and intrinsic activities on mu receptor phosphorylation and desensitization . Exposure to the potent full agonists sufentanil , dihydroetorphine , etorphine , etonitazine , and [ D-Ala 2 , MePhe 4 , Glyol 5 ] enkephalin ( DAMGO ) led to strong receptor phosphorylation , while methadone , l-alpha-acetylmethadone ( DB01227 ) , morphine , meperidine , DADL , beta-endorphin ( 1-31 ) , enkephalins , and dynorphin A ( 1-17 ) produced intermediate effects . The partial agonist buprenorphine minimally enhanced receptor phosphorylation while antagonists failed to alter phosphorylation . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00921
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 and full antagonists each antagonized the enhanced mu receptor phosphorylation induced by morphine or DAMGO . The rank order of opiate ligand efficacies in producing mu receptor-mediated functional desensitization generally paralleled their rank order of efficacies in producing receptor phosphorylation . Interestingly , the desensitization and phosphorylation mediated by methadone and DB01227 were disproportionate to their efficacies in two distinct test systems . This generally good fit between the efficacies of opiates in mu receptor activation , phosphorylation , and desensitization supports the idea that activated receptor / agonist / G-protein complexes and / or receptor conformational changes induced by agonists are required for agonist-induced mu receptor phosphorylation . Data for methadone and DB01227 suggest possible contribution from their enhanced desensitizing abilities to their therapeutic efficacies .</div>
